        private static int GetHash(string text)
        {
            int m = text.Length;
            int result = 0;
            foreach (var character in text)
            {
                result = (B * result + (int)character) % Q;
            }

            return result;
        }
        private static List<int> SearchPatternsInText(string mainString, string substring)
        {
            List<int> substringPositions = new List<int>();
            int mainStringLength = mainString.Length;
            int subStringLength = substring.Length;
            int multiplier = 1;

            for (int i = 1; i < subStringLength; i++)
            {
                multiplier = (multiplier * B) % Q;
            }

            int subStringHash = GetHash(substring);
            int textHash = GetHash(mainString.Substring(0, subStringLength));

            int counter = 0;

            for (int i = 0; i < mainStringLength - subStringLength; i++)
            {
                if (subStringHash == textHash)
                {
                    if (mainString.Substring(i - 1, subStringLength) == substring)
                    {
                        counter++;
                        substringPositions.Add(i - 1);
                    }
                }

                textHash = GetHash(mainString.Substring(i, subStringLength));
